import React from "react";
import { Drawer } from "antd";
const ReservationDrawer = ({ visible }) => {
  return (
    <Drawer
      title="Reserv place"
      visible={visible}
      closable={false}
      placement="top"
    />
  );
};

export default ReservationDrawer;
